import React from 'react';
import {Card} from 'antd';

const userProfile = () => {
    return(
    <Card
        actions={[
            <div key="twit">Kukvly<br/>0</div>,
            <div key="followings">Followings<br/>0</div>,
            <div key="followers">Followers<br/>0</div>,
        ]}
    >
        <Card.Meta
            avatar={<Avatar>YK</Avatar>}
            title="Kuks"
        />
    </Card>

    );
}

export default userProfile;
